import React, { Component } from "react";

class File extends Component{
    render (){
        const names=["ayman","ahmed"]
   const S=   names.map(function(e){
            return `<h1>hi ${e}</h1>`
        })
        console.log(S[0])
        return(
            S[0]
        )
    }
}

export default File
